import React from 'react';
import './Contacts.css';
import blob from './images/greenblob.png';


function ContactPage() {
    return (  
        <div class="contact-main-div">
             <h2 class="contact-header">contact</h2>
             <div id="invite">

                 <img src={blob} alt="mint green blob" />

             </div>

        </div>



    )
} 

export default ContactPage;
